import React from "react";
import { Container, Typography, Box, Divider, Paper } from "@material-ui/core";
import Button from "@material-ui/core/Button";

const ObjectPage = ({ id, onBack }) => {
  return (
    <Container>
      {/* Header section with the reimbursement ID */}
      <Box display="flex" alignItems="center" justifyContent="space-between" mb={2}>
        <Typography variant="h4">Reimbursement ID: {id}</Typography>
        <Button variant="contained" color="secondary" onClick={onBack}>
          Back to List
        </Button>
      </Box>

      <Divider />

      {/* Subsections */}
      <Box mt={3}>
        <Paper variant="outlined" style={{ padding: "16px", marginBottom: "16px" }}>
          <Typography variant="h5">General Information</Typography>
          {/* General information content goes here */}
          <Typography variant="body1">This section contains general information about the reimbursement.</Typography>
        </Paper>

        <Paper variant="outlined" style={{ padding: "16px", marginBottom: "16px" }}>
          <Typography variant="h5">Reimbursement Details</Typography>
          {/* Reimbursement details content goes here */}
          <Typography variant="body1">This section contains detailed information about the reimbursement.</Typography>
        </Paper>

        <Paper variant="outlined" style={{ padding: "16px", marginBottom: "16px" }}>
          <Typography variant="h5">Attachments</Typography>
          {/* Attachments content goes here */}
          <Typography variant="body1">This section contains any attachments related to the reimbursement.</Typography>
        </Paper>

        <Paper variant="outlined" style={{ padding: "16px", marginBottom: "16px" }}>
          <Typography variant="h5">Workflow History</Typography>
          {/* Workflow history content goes here */}
          <Typography variant="body1">This section contains the workflow history of the reimbursement.</Typography>
        </Paper>

        <Paper variant="outlined" style={{ padding: "16px", marginBottom: "16px" }}>
          <Typography variant="h5">Comments</Typography>
          {/* Comments content goes here */}
          <Typography variant="body1">This section contains comments related to the reimbursement.</Typography>
        </Paper>
      </Box>
    </Container>
  );
};

export default ObjectPage;
